import React from 'react';
import '../styles/Services.css';

function Services() {
  return (
    <section className="services" id="services">
      <h2>Our Services</h2>
      <div className="services-grid">
        <div className="service">
          <h3>Unclaimed Asset Recovery</h3>
          <p>We locate and reclaim lost or overlooked funds for individuals and families.</p>
        </div>
        <div className="service">
          <h3>Inheritance Navigation</h3>
          <p>Guiding heirs through legal, financial, and emotional decisions after a loved one passes.</p>
        </div>
        <div className="service">
          <h3>Generational Wealth Planning</h3>
          <p>Building financial literacy and long-term value through educational support and resources.</p>
        </div>
      </div>
    </section>
  );
}

export default Services;
